write code for me image upload in php
model
```php
<?php

// Define the upload directory
$uploadDir = 'uploads/';

// Get the file extension
$extension = strtolower(pathinfo($_FILES['image']['name'], PATHINFO_EXTENSION));

// Allowed file extensions
$allowedExtensions = array('jpg', 'jpeg', 'png', 'gif');

// Check if the file extension is allowed
if (!in_array($extension, $allowedExtensions)) {
  echo 'Error: Invalid file extension.';
  exit;
}

// Get the file size
$size = $_FILES['image']['size'];

// Check if the file size is within the allowed limit
if ($size > 2097152) {
  echo 'Error: File size too large.';
  exit;
}

// Generate a unique file name
$fileName = uniqid() . '.' . $extension;

// Upload the file to the server
move_uploaded_file($_FILES['image']['tmp_name'], $uploadDir . $fileName);

// Print the file name
echo 'File name: ' . $fileName;

?>
```

**Notes:**

* The `$uploadDir` variable defines the directory where the uploaded file will be stored.
* The `pathinfo()` function is used to get the file extension.
* The `allowedExtensions` array defines the allowed file extensions.
* The `if (!in_array($extension, $allowedExtensions))` statement checks if the file extension is allowed.
* The `$size` variable stores the file size.
* The `if ($size > 2097152)` statement checks if the file size is within the allowed limit.
* The `uniqid()` function generates a unique file name.
* The `move_uploaded_file()` function moves the uploaded file to the server.
* The `echo 'File name: ' . $fileName'` statement prints the file name.

**Example Usage:**

To use this code, simply upload an image file to the server by submitting the following form:

```html
<form action="upload.php" method="post" enctype="multipart/form-data">
  <label for="image">Image:</label>
  <input type="file" id="image" name="image">
  <input type="submit" value

