in javascript i have a long string (up to 100 characters). I want to be able to encode this string into a short string so it's easily shareable via a url and then decode the shared string
model
Here's how to encode and decode a long string in JavaScript:

**Encoding:**

```javascript
const longString = "This is a long string that I want to shorten";

const encodedString = encodeURIComponent(longString);

console.log("Encoded string:", encodedString);
```

**Decoding:**

```javascript
const encodedString = "This%20is%20a%20long%20string%20that%20I%20want%20to%20shorten";

const decodedString = decodeURIComponent(encodedString);

console.log("Decoded string:", decodedString);
```

**Explanation:**

* `encodeURIComponent()` function takes a string as input and encodes it using the UTF-8 character encoding. It replaces all characters that are not ASCII letters or numbers with their encoded equivalents.
* The encoded string can be safely shared via a URL.
* `decodeURIComponent()` function takes an encoded string as input and decodes it back into its original form.

**Example:**

```
const longString = "This is a long string that I want to shorten";

const encodedString = encodeURIComponent(longString);

const decodedString = decodeURIComponent(encodedString);

console.log("Original string:", longString);
console.log("Encoded string:", encodedString);
console.log("Decoded string:", decodedString);

// Output:
// Original string: This is a long string that I want to shorten
// Encoded string: This%20is%20a%20long%20string%20that%20I%20want%20to%20shorten
// Decoded string: This is a long string that I want to shorten
```

**Note:**

* The maximum length of a URL parameter in most browsers is 255 characters. So, if your string is longer than that, you may need to use a different encoding method.
* You can also use `btoa()` and `atob()` functions instead of `encodeURIComponent()` and `decodeURIComponent()` if you want to encode and decode binary data.

